import React from 'react'
import {Grid, Typography} from '@material-ui/core'

const SignUp = () => {
    const paperStyle = {padding: '30px 20px', width}
    return (
        <Grid>
            <Typography elevation={20} style={paperStyle}>
                <h2>Sign Up</h2>
            </Typography>
        </Grid>
    )
}

export default SignUp
